import React, { Component } from "react";
import { BrowserRouter as Router, Swith, Route } from "react-router-dom";
import Topo from "./components/topo";
import Home from "./components/home";
import Frontend from "./components/frontend";
import Programacao from "./components/programacao";
import Design from "./components/design";
import Catalogo from "./components/catalogo";
import NotFound from "./components/cotFound";
import Rodape from "./components/rodape";
import ".index/css";
class App extends Component {
  render() {
    return (
      <Router>
        <>
          <Topo />
          <Swith>
            <Route exact path="/" render={Home} />
            <Route exact path="/frontend" render={() => <Frontend />} />
            <Route exact path="/programacao" render={() => <Programacao />} />
            <Route exact path="/design" render={() => <Design />} />
            <Route exact path="/catalago" render={(props) => <Catalogo />} />
            <Route Component={NotFound} />
          </Swith>
        </>
      </Router>
    );
  }
}

export default App;
